/*
 * @Descripttion:
 * @Author: zhaokh
 * @Date: 2020-01-29 14:34:29
 */
import React from "react";
import Head from "next/head";
import Header from "../components/Header";
import { Row, Col } from "antd";

const Home = () => (
  <div>
    <Head>
      <title>Home</title>
      <link rel="icon" href="/favicon.ico" />
    </Head>
    <Header />

    <Row className="common-main">
      <Col className="common-left">左边</Col>
      <Col className="common-right">右边</Col>
    </Row>
  </div>
);

export default Home;
